-- Asignaciones

-- de Error

SELECT rut_ingeniero, titulo_error
FROM (
    SELECT 
        Ingeniero.RUT AS rut_ingeniero,
        Error.Titulo AS titulo_error,
        ROW_NUMBER() OVER (PARTITION BY Error.Titulo ORDER BY NEWID()) AS cantidad_asignados,
		ROW_NUMBER() OVER (PARTITION BY Ingeniero.RUT ORDER BY NEWID()) AS asignaciones_por_ingeniero
    FROM Error INNER JOIN Ingeniero ON Ingeniero.Especialidad LIKE '%'+Error.Topico+'%'
) tabla
WHERE cantidad_asignados <=3 AND asignaciones_por_ingeniero <= 20;



-- de Funcionalidad


SELECT rut_ingeniero, titulo_funcionalidad
FROM (
    SELECT 
        Ingeniero.RUT AS rut_ingeniero,
        Funcionalidad.Titulo AS titulo_funcionalidad,
        ROW_NUMBER() OVER (PARTITION BY Funcionalidad.Titulo ORDER BY NEWID()) AS cantidad_asignados,
		ROW_NUMBER() OVER (PARTITION BY Ingeniero.RUT ORDER BY NEWID()) AS asignaciones_por_ingeniero
    FROM Funcionalidad INNER JOIN Ingeniero ON Ingeniero.Especialidad LIKE '%'+Funcionalidad.Topico+'%'
) tabla
WHERE cantidad_asignados <= 3 AND asignaciones_por_ingeniero <= 20;




